import './index.css'

const Showcase=()=>{

    const images=[showcase1,showcase2,showcase3]
    const [photo,setPhoto]=useState(1);
    return(
        <section className='space-showcase section-margin'>{
            images.map((value,index)=>{
                if(index===photo){
                    return(
                        <div>
                            <img src={value} alt="" />
                        </div>
                    )
                }return <></>
            })    
        }
            <button><span class="material-symbols-outlined">arrow_forward_ios</span></button>
            <button></button>
        </section>
    )
}
export default Showcase
